<!DOCTYPE html>
<html lang="en">

<head>
<meta charset="UTF-8">
<link rel="stylesheet" href="foundation.min.css">
<title>test</title>
<style>
html,
body {
position: relative;
width: 100%;
height: 100%;
margin: 0;
padding:0;
}

svg {
position: absolute;
left: 50%;
transform: translateX(-50%);
}

path {
fill: white;
transition: 0.5s all ease;
}
/*
path:focus {
fill: gray;
}
*/

#modalBox {
display: none;
width: 90%;
height: 100%;
position: fixed;
left: 5%;
top: 50%;
transform: translateY(-50%);
background-color: rgba(0, 0, 0, 0.8);
z-index: 20;
overflow: auto;
}

.modalInner {
display: inline-block;
position: absolute;
text-align: center;
-webkit-text-align:center;
left: 50%;
transform: translateX(-50%);
color: white;
}

.mp-row {
overflow: hidden;
text-align: center;
padding: 20px 0;
}

h1 {
text-align: center;
}

h2,
h3,
h4,
h5,
h6 {
margin: 0;
}

    table {
        border-collapse: collapse;
        width: 100%;
    }

    th, td {
        text-align: left;
        padding: 8px;
    }

    tr:nth-child(even){
        background-color: #f2f2f2

    }
    tr:nth-child(even) td {
        color:black;
    }

    tr:nth-child(odd){
        background-color: black;

    }
    tr:nth-child(odd) td {
        color:white;
    }

    th {
        background-color: #4CAF50;
        color: white;
    }
/*
    td {
        width:25%;
        padding:30px;
    }
*/
</style>
</head>
<!--    I shoud use foundation or something similar -->

